Δεδομένου ότι Οι ορθολογικές προσδοκίες αυξήθηκαν, εν μέρει, από μια προσπάθεια κατανόησης των πραγματικών επενδύσεων στα χρηματιστήρια. Επομένως, πρέπει να ισχύει ότι "Ο κόσμος προσπαθούσε να μάθει για τις συναλλαγές στα χρηματιστήρια μετοχών."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι είναι πραγματικά κακό Επομένως, πρέπει να ισχύει ότι "Έχω ακούσει ότι δεν είναι καλό."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Η βιόσφαιρα έχει επεκταθεί, πράγματι, περισσότερο ή λιγότερο επιθετικά, εξερράγη, στο συνεχώς διευρυνόμενο  παρακείμενα δυνατόν. Επομένως, πρέπει να ισχύει ότι "Η βιόσφαιρα αυξήθηκε."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
